import React from "react";
import styles from "./Home.module.css";

const Home: React.FC = () => {
  return (
    <div className={styles.container}>
      <header className={styles.header}>
        <h1 className={styles.title}>
          Georgia Tech Stinger Shuttle Delay Visualizer
        </h1>
        <p className={styles.subtitle}>
          A Georgia Tech's Big Data Big Impact project.
        </p>
      </header>

      <section className={styles.content}>
        {/* TODO: insert components here */}
        <p>Select a bus line and stop to see delay data visualizations.</p>
      </section>

      <footer className={styles.footer}>
        &copy; {new Date().getFullYear()} Stinger Delay
      </footer>
    </div>
  );
};

export default Home;
